* Copy can now accurately copy cyclic structures.
* Equals can now accurately assess equality of cyclic structures.
* This should enable watching of cyclic objects.

Eg: copy and equals should work as expected in the following:
```
var obj = {name: "value"};
obj['nested'] = {self: obj};

var cpy = copy(obj);
expect(equals(obj, copy)).toBe(true);
expect(obj['nested']['self']).toBe(obj);
```

However, this is NOT graph copy.
Eg.
```
var obj = {name: "value"};
nested = {level2: "level2"};
obj['nested1'] = nested;
obj['nested2'] = nested;
var cpy = copy(obj);
expect(equals(obj, copy).toBe(true);

//This will fail. Although they were the same
//in the original object, they are distinct copies now.
expect(cpy['nested1']).toBe(cpy['nested2']);
```

The resolve callback allows the application code to modify the
resolved url before it is normailzed by urlParsingNode.href for example:

var parsed = $urlUtils.resolve("foo", function(urlUtils) {
  urlUtils.protocol =
    urlUtils.protocol === 'https:' ? 'wss:' : 'ws:';
});
parsed.href // wss://localhost/foo

The resolved url object now includes the aditional properties hostname,
port, pathname, hash and search.

